import React from 'react';
import "./IndividualFriendsUserSetting.css";
import {uid} from 'react-uid';
class IndividualList extends React.Component{
    state = {
        ListName: "Home Grown Ingredients",
        Category: "Ingredients",
        ListDescription: "My favourite ingredients that I grow in my garden",
        FoodRank: [{Rank: 1, FoodName: "Spinach", Notes: ""},
                    {Rank: 2, FoodName: "Tomato", Notes: "Sour"},
                    {Rank: 3, FoodName: "Potato", Notes: "used for fries"}]
    }
    ListDescription(){
        return(
            <div id='ListDescription'>
                <h2>List Description</h2>
                <p>{this.state.ListDescription}</p>
            </div>
        )
    }


    Header(){
        return(
            <div id='HeaderIndividualList'>
                <h1>{this.state.ListName + "(" + this.state.Category + ")"}</h1>
                <button type="button" className='AddNewList'> Add a new list item</button>
                <span className='EmptySpace'> </span>
                <button type="button" className='DeleteWholeList'> Delete the whole list </button>
            </div>
        )
    }

    TableRow(info){
        return(
            <tr key={uid(info)}>
                <td>
                    <strong>{info.Rank}</strong>
                </td>
                <td>
                    <strong>{info.FoodName}</strong>
                </td>
                <td>
                    <strong>{info.Notes}</strong>
                </td>
                <td>
                    <button type="button" className='editIndividualList'> edit </button>
                </td>
                <td>
                    <button type="button" className='deleteIndividualList'> delete </button>
                </td>
            </tr>
        )
    }


    Table(){
        return(
            <table>
                <tbody>
                <tr>
                    <th>Rank</th>
                    <th>FoodName</th>
                    <th>Notes</th>
                    <th>Edit</th>
                    <th>Delete</th>
                </tr>
                {this.state.FoodRank.map(info => {return this.TableRow(info)})}
                </tbody>
            </table>
        )
    }

    render() {
        return(
            <div>
                <div><button className='back'>Back</button></div>
                <hr/>
                {this.Header()}
                <br/>
                {this.Table()}
                {this.ListDescription()}
            </div>
        )
    }
}


export default IndividualList;
